import React from 'react';
import $ from 'jquery';
import { Link } from '@reach/router';

import SiteNavbar from './SiteNavbar';

import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

import LandingPhoto from '../img/landingheader.png';
import LandingLogo from '../img/landingLogo.png';
import LandingDescriptionPhoto from '../img/landingDescriptionPhoto.png';

import '../css/Landing.css';

const Landing = () => {
	$(document).ready(function () {
		/* Check the location of each desired element */
		$('.fade-in').each(function (i) {
			var half_of_object = $(this).offset().top + $(this).outerHeight() / 2;
			var bottom_of_window = $(window).scrollTop() + $(window).height();

			/* If the object is completely visible in the window, fade it it */
			if (bottom_of_window > half_of_object) {
				$(this).animate({ opacity: '1' }, 550);
			}
		});
		/* Every time the window is scrolled */
		$(window).scroll(function () {
			/* Check the location of each desired element */
			$('.fade-in').each(function (i) {
				var half_of_object = $(this).offset().top + $(this).outerHeight() / 2;
				var bottom_of_window = $(window).scrollTop() + $(window).height();

				/* If the object is completely visible in the window, fade it it */
				if (bottom_of_window > half_of_object) {
					$(this).animate({ opacity: '1' }, 350);
				}
			});
		});
	});
	return (
		<div className="landing">
			<SiteNavbar sticky="false" bg="transparent" />
			<div style={style.LandingDiv}>
				<img src={LandingLogo} alt="landing logo" />
				<h2 style={style.LandingSubtitle}>
					Berkeley's Premiere Formula SAE Electric Vehicle Team
				</h2>
				<Button className="landing-button">
					<Link to="/about" className="link-tag">
						<p>Learn More</p>
					</Link>
				</Button>
			</div>
			<Container fluid className="body">
				<Row noGutters="true">
					<Col xs={6}>
						<h3>Our Mission</h3>
						<hr />
						<div className="text-container">
							<p className="text fade-in">
								Create a{' '}
								<b className="yellow">community of diverse individuals</b> that
								focuses on learning and skill development.
							</p>
							<p className="text fade-in">
								Research, design, manufacture, and test{' '}
								<b className="blue">
									efficient, sustainable transportation technology
								</b>{' '}
								at UC Berkeley.
							</p>
							<p className="text fade-in">
								Compete in the annual{' '}
								<b className="yellow">Formula SAE Electric Competition</b> to
								demonstrate our technology at a global scale.
							</p>
						</div>
						<Button className="join-button fade-in">
							<Link to="/apply" className="link-tag">
								<p>Join The Team</p>
							</Link>
						</Button>
					</Col>
					<Col xs={6} className="text-center">
						<img
							src={LandingDescriptionPhoto}
							alt="landing description"
							className="text-image"
						/>
					</Col>
				</Row>
			</Container>
		</div>
	);
};

const style = {
	LandingDiv: {
		width: '100%',
		//border: '1px solid blue',
		height: '0',
		paddingTop: '35%',
		display: 'flex',
		flexDirection: 'column',
		alignItems: 'center',
		justifyContent: 'flex-end',
		backgroundImage: `url(${LandingPhoto})`,
		// backgroundPosition: '0 10vh',
		backgroundRepeat: 'no-repeat',
		// backgroundAttachment: 'fixed',
		backgroundSize: '100%',
	},
	LandingSubtitle: {
		margin: '3% 0',
		color: '#ffffff',
		fontFamily: 'Titillium Web',
	},
};

export default Landing;
